class Solution:
    def func(self, dice_cnt: int, sum_to_find: int, nums: list) -> int:
        nums.sort()

        max_prob = 0
        for i in range(1, dice_cnt + 1):
            prob = self.get_prob(sum_to_find, nums, i)
            if prob > max_prob:
                max_prob = prob
        return max_prob

    def get_prob(self, target_sum: int, nums: list, dice_cnt: int) -> int:
        dices = self.create_dices(nums, dice_cnt)
        return self.get_prob_helper(dices, target_sum)

    def create_dices(self, nums: list, dice_cnt: int) -> dict:
        dices = {}
        for i in range(len(nums)):
            dices[nums[i]] = dices.get(nums[i], 0) + 1

        for num, count in dices.items():
            if count == 1:
                del dices[num]
            elif count > 1:
                dices[num] = count % 6

        return dices

    def get_prob_helper(self, dices: dict, target_sum: int) -> int:
        total_prob = 1
        for num, count in dices.items():
            total_prob *= self.get_prob_helper_helper(num, target_sum) ** count

        return total_prob

    def get_prob_helper_helper(self, num: int, target_sum: int) -> int:
        if num > target_sum:
            return 0

        if num == target_sum:
            return 1

        if num < target_sum:
            return 0

        if num * 6 == target_sum:
            return 1

        if (target_sum - num) * 6 == num:
            return 1

        return 0

