import re
from typing import List

class Solution:
    def new_notation(self, stdin: str) -> str:
        if not stdin:
            return ""

        stdin = stdin.replace("()", "1,1:1,1:")
        stdin = stdin.replace("(", "1,")
        stdin = stdin.replace(")", "1:")
        stdin = stdin.replace("[", "2,")
        stdin = stdin.replace("]", "2:")
        stdin = stdin.replace("{", "3,")
        stdin = stdin.replace("}", "3:")

        return stdin

    def get_numbers(self, stdin: str) -> List[int]:
        result = []
        for m in re.finditer(r"\d+", stdin):
            result.append(int(m.group()))
        return result

    def get_bracket_notation(self, stdin: str) -> List[int]:
        result = []
        for m in re.finditer(r"(\d+),(\d+):(\d+),(\d+)", stdin):
            result.append([int(m.group(1)), int(m.group(2))])
        return result

    def solution(self, stdin: str) -> str:
        stdin = self.new_notation(stdin)
        numbers = self.get_numbers(stdin)
        bracket_notation = self.get_bracket_notation(stdin)

        length = len(numbers)
        brackets = {}
        for i in range(length):
            brackets[i] = bracket_notation[i]
            brackets[bracket_notation[i][1]] = bracket_notation[i]

        min_length = 2 ** 20
        for i in range(length):
            count = 0
            for j in range(length):
                if i == j:
                    continue
                if (bracket_notation[i][0] < bracket_notation[j][0] and bracket_notation[i][1] > bracket_notation[j][1]):
                    count += 1
            if count < min_length:
                min_length = count

        return ",".join(str(num) for num in numbers[min_length:length])

