class Polygon:
    def __init__(self, points: List[Point]):
        self.points = points

    def __repr__(self):
        return f"{self.__class__.__name__}({self.points})"

    def __eq__(self, other: object) -> bool:
        return isinstance(other, Polygon) and self.points == other.points

    def __hash__(self):
        return hash(self.points)

    def __iter__(self):
        return iter(self.points)

    def inside(self, point: Point) -> bool:
        """Check if point is inside polygon"""
        points_iter = iter(self.points)
        points_iter_len = len(self.points)
        for _ in range(points_iter_len - 1):
            prev_point = next(points_iter)
            next_point = next(points_iter)
            if prev_point.y <= point.y < next_point.y or next_point.y <= point.y < prev_point.y:
                if (point.x - prev_point.x) * (point.y - next_point.y) == (next_point.x - prev_point.x) * (point.y - prev_point.y):
                    return True
        return False

    def outside(self, point: Point) -> bool:
        """Check if point is outside polygon"""
        return not self.inside(point)

    def intersects(self, other: "Polygon") -> bool:
        """Check if polygon intersects with another polygon"""
        for p1 in self:
            for p2 in other:
                if p1 == p2:
                    return True
                if Point(p1.x, p2.y) == Point(p2.x, p1.y):
                    return True
        return False

    def contains(self, other: "Polygon") -> bool:
        """Check if polygon contains other polygon"""
        if isinstance(other, Polygon):
            for p1 in self:
                for p2 in other:
                    if p1 == p2:
                        return True
        else:
            raise ValueError(f"Expected {Polygon.__name__} object, but received {type(other).__name__}")
        return False


class Solution:
    def get_points(self, point_iter: Iterator[str]) -> List[Point]:
        points: List[Point] = []
        for point in point_iter:
            x, y = point.split()
            points.append(Point(float(x), float(y)))
        return points

    def solve(self, stdin: str) -> str:
        point_iter = stream_lines(stdin)
        points = self.get_points(point_iter)
        polygons: List[Polygon] = [Polygon(p) for p in self.get_all_polygons(points)]
        return str(len([p for p in polygons if p.inside(points[0])]))

    def get_all_polygons(self, points: List[Point]) -> List[Polygon]:
        polygons = []
        for i, p0 in enumerate(points):
