    def longestMonotonicSubsequence2(self, nums, start, end):
        if end - start < self.K:
            return []
        if start == end:
            return [nums[start]]

        if nums[start] == nums[end]:
            return self.longestMonotonicSubsequence2(nums, start + 1, end - 1)

        left = self.longestMonotonicSubsequence2(nums, start, (start + end) // 2)
        right = self.longestMonotonicSubsequence2(nums, (start + end) // 2 + 1, end)

        result = self.merge(left, right)
        return result

    def reorder(self, nums):
        result = []
        for num in nums:
            if len(result) == 0 or result[-1] <= num:
                result.append(num)
            else:
                idx = self.find_insert_position(result, num)
                result = result[:idx] + [num] + result[idx:]

        return result

    def find_insert_position(self, nums, num):
        left = 0
        right = len(nums)

        while left < right:
            mid = left + (right - left) // 2
            if nums[mid] <= num:
                left = mid + 1
            else:
                right = mid

        return left

    def merge(self, left, right):
        result = []

        while len(left)!= 0 and len(right)!= 0:
            if left[0] <= right[0]:
                result.append(left.pop(0))
            else:
                result.append(right.pop(0))

        result += left
        result += right

        return result


