class Expression:
    def __init__(self, expression):
        self.expression = expression
        self.re_match = re.match(r"(\d+)\+(\d+)\*x", expression)
        self.A = int(self.re_match.group(1))
        self.P = int(self.re_match.group(2))
        self.M = int(self.re_match.group(3))

    def __repr__(self):
        return self.expression

    def __str__(self):
        return self.expression

    def get_variables(self):
        variables = set()
        for char in self.expression:
            if char == "x":
                variables.add(char)
        return variables

    def get_min(self):
        variables = self.get_variables()
        if len(variables) == 0:
            return 0

        def get_bracket(expr: str, start: int, end: int) -> int:
            bracket_content = expr[start:end]
            bracket_content = bracket_content.split("*")
            bracket_content = [int(bracket_content[0]), int(bracket_content[1])]
            bracket_content.sort(reverse=True)
            return bracket_content[0] * bracket_content[1]

        def get_first_non_zero(expr: str, start: int, end: int) -> int:
            while start > 0:
                if expr[start] == "0":
                    start -= 1
                elif expr[start]!= "x":
                    return start
                else:
                    break
            return start

        start, end = self.expression.find("(", 0, len(self.expression)), 0
        while start >= 0 and end >= 0:
            if self.expression[start:end] == "x":
                end = get_first_non_zero(self.expression, end + 1, len(self.expression))
            elif self.expression[start:end] == "(":
                bracket_content = get_bracket(self.expression, start, end)
                if bracket_content >= 0:
                    end = get_first_non_zero(self.expression, end + 1, len(self.expression))
            start = self.expression.find("(", end, len(self.expression))
            end = self.expression.find(")", start, len(self.expression))
        expression = self.expression[start + 1:end]

        non_negative = []
        for variable in variables:
            non_negative.append(Expression(variable + "*" + expression))
        non_negative.sort(key=lambda expr: expr.A)
        for index in range(len(non_negative)):
            non_negative[index].A = non_negative[index].A * non_negative[index - 1].M // (
                non_negative[index - 1].M - non_negative[index - 1].A
            )
        if non_negative[0].A == 0:
            return 0

        return non_negative[0].A // non_negative[0].M


