            point = pointList[i]
            if (i == 0):
                prevPoint = pointList[-1]
            else:
                prevPoint = pointList[i - 1]
            if (i == len(pointList) - 1):
                nextPoint = pointList[0]
            else:
                nextPoint = pointList[i + 1]
            if ((point[0] - prevPoint[0]) * (nextPoint[1] - point[1]) == (nextPoint[0] - point[0]) * (point[1] - prevPoint[1])):
                return False
        return True

