from collections import defaultdict
from typing import Set


class Zoo:
    def __init__(self, n_enclosures: int, n_animals: int, animal_enclosure: str):
        self.n_enclosures = n_enclosures
        self.n_animals = n_animals
        self.enclosure_info = defaultdict(int)
        for line in animal_enclosure:
            enclosure, amount = line.split()
            self.enclosure_info[enclosure] += int(amount)

        self.enclosure_names = sorted(self.enclosure_info.keys())
        self.enclosure_map = {
            enclosure: i
            for i, enclosure in enumerate(self.enclosure_names)
        }

        self.animal_enclosures: Set[str] = set(
            self.enclosure_info.keys()
        )
        for animal, count in self.enclosure_info.items():
            for _ in range(count):
                self.animal_enclosures.remove(animal)

    def get_current_enclosures(self) -> Set[str]:
        return {
            animal
            for animal, count in self.enclosure_info.items()
            if count > 0
        }

    def get_remaining_enclosures(self) -> Set[str]:
        return set(self.enclosure_names) - self.get_current_enclosures()

    def get_reconstructed_enclosures(self) -> Set[str]:
        # If we are able to reconstruct all of the enclosures
        # it means that every animal can be moved from one
        # enclosure to another
        reconstructed_enclosures = self.animal_enclosures
        for animal in self.animal_enclosures:
            if self.enclosure_info[animal] == 1:
                reconstructed_enclosures.discard(animal)

        return reconstructed_enclosures

    def move_animals(self) -> bool:
        # At the beginning, all the animals are in the correct enclosures
        moved_animals = set()
        while len(self.get_remaining_enclosures()) > 0:
            for animal, count in self.enclosure_info.items():
                if count > 0:
                    if count == 1:
                        if self.enclosure_info[animal] == 1:
                            if animal in moved_animals:
                                continue
                            else:
                                self.enclosure_info[animal] -= 1
                                moved_animals.add(animal)
                        else:
                            self.enclosure_info[animal] -= 1
                            moved_animals.add(animal)
                    else:
                        if animal not in moved_animals:
                            moved_animals.add(animal)
                            self.enclosure_info[animal] -= 1

                    if len(moved_animals) == self.n_animals:
                        return True
                    else:
                        return False
        return False

