class Solution:
    def sum_of_left_and_right(self, node: str) -> int:
        def helper(node: str) -> int:
            if node.startswith('-'):
                return -helper(node[1:])
            return sum(helper(node[1:]) + ord(node[0]) - 96)

        return helper(node)

    def sum_of_left_and_right_with_graph(self, node: str) -> int:
        graph: List[List[int]] = [[0, 0]]
        for char in node:
            graph.append([graph[-1][0] + ord(char) - 96, 1])
            graph.append([graph[-1][0] - ord(char) + 96, 0])

        def helper(node: int, is_left: bool) -> int:
            if is_left:
                return graph[node][0]
            return graph[node][1]

        return helper(node, True) + helper(node, False)

    def get_leaves_preorder(self, node: str) -> List[str]:
        def helper(node: str, root: str, is_left: bool) -> None:
            if node == root:
                if is_left:
                    self.leaves.append(root)
                else:
                    self.leaves.append(root)
                return

            if not node.startswith(root):
                self.leaves.append(node)
                return

            if node.startswith(root):
                helper(node[1:], root, True)
                helper(node[1:], root, False)
                return

        self.leaves = list()
        helper(node, node, True)
        helper(node, node, False)
        return self.leaves

    def dfs(self, node: str, level: int, graph: List[List[int]], graph_left: List[List[int]]) -> None:
        if node == '*':
            return

        if node.startswith('-'):
            self.dfs(node[1:], level, graph, graph_left)
            self.dfs(node[1:], level, graph, graph_left)
            return

        if node.startswith('+'):
            self.dfs(node[1:], level, graph, graph_left)
            self.dfs(node[1:], level, graph, graph_left)
            return

        left = self.sum_of_left_and_right(node)
        right = self.sum_of_left_and_right(node)
        graph[level][0] += right
        graph[level][1] += left
        graph_left[level][0] += left
        graph_left[level][1] += right

        self.dfs(node[1:], level + 1, graph, graph_left)

    def build_graph(self, node: str) -> List[List[int]]:
        graph = [[0, 0]]
        graph_left = [[0, 0]]

        self.dfs(node, 0, graph, graph_left)
        return graph

    def construct_tree(self, root: str, graph: List[List[int]], graph_left: List[List[int]]) -> List[str]:
        if root == '*':
            return []

        if root.startswith('-'):
            return self.construct_tree(root[1:], graph, graph_left) + self.construct_tree(root[1:], graph, graph_left)

        if root.startswith('+'):
            return self.construct_tree(root[1:], graph, graph_left) + self.construct_tree(root[1:], graph, graph_left)

        left = self.sum_of_left_and_right(root)
        right = self.sum_of_left_and_right(root)
        graph[0][0] += right
        graph[0][1] += left
        graph_left[0][0] += left
        graph_left[0][1] += right

        if root[1:]:
            return self.construct_tree(root[1:], graph, graph_left) + [root] + self.construct_tree(root[1:], graph, graph_left)
        else:
            return [root]

    def solve(self, root: str, graph: List[List[int]], graph_left: List[List[int]]) -> str:
        leaves = self.get_leaves_preorder(root)
        for leaf in leaves:
            graph.append([0, 0])
            graph_left.append([0, 0])

        tree = self.construct_tree(root, graph, graph_left)
        return''.join(tree)


