import string
from collections import Counter
from typing import Iterator


class Solution:
    def count_edges(self, edges: Iterator[tuple[int, int]]) -> Counter[int]:
        count = Counter()
        for u, v in edges:
            count[u] += 1
            count[v] += 1
        return count

    def is_valid(self, edges: Counter[int]) -> bool:
        count = self.count_edges(edges)
        for u, v in count.items():
            if v % 2!= 0:
                return False
        return True

    def connected_components(self, edges: Counter[int]) -> list[list[int]]:
        count = self.count_edges(edges)
        return [
            [edge[0] for edge in edges if edge[0] == v]
            for v in range(1, len(count) + 1)
            if count[v] % 2 == 0
        ]

    def connected_components_depth_first_search(
        self, edges: Counter[int]
    ) -> list[list[int]]:
        count = self.count_edges(edges)
        n = len(count)
        visited = [False] * (n + 1)
        components = []
        for v in range(1, n + 1):
            if not visited[v]:
                component = []
                self.dfs(edges, visited, v, component)
                components.append(component)
        return components

    def dfs(
        self, edges: Counter[int], visited: list[bool], v: int, component: list[int]
    ) -> None:
        visited[v] = True
        component.append(v)
        for w in edges[v]:
            if not visited[w]:
                self.dfs(edges, visited, w, component)

    def solve(self, n: int, edges: list[tuple[int, int]]) -> str:
        components = self.connected_components_depth_first_search(edges)
        if not components:
            return "impossible"
        for component in components:
            component.sort()
            if component!= [1, 2, 3, 4, 5]:
                return "impossible"
        return "LL" * (n - 1)

