import math


class Solution:
    def findPoint(self, a: int, b: int, c: int) -> tuple:
        if abs(b) > abs(a):
            a, b = b, a
        if abs(c) > abs(a):
            a, c = c, a
        if b == 0:
            return (0, c // a)
        if c == 0:
            return (a // b, 0)
        r = a // b
        q = c // b
        if r == q:
            return (r, 0)
        if r < q:
            return (r + 1, c - r * b)
        return (r, c - r * b)

    def findPointOnFirst(self, a: int, b: int, c: int) -> tuple:
        if abs(b) > abs(a):
            a, b = b, a
        if abs(c) > abs(a):
            a, c = c, a
        if b == 0:
            return (0, c // a)
        if c == 0:
            return (a // b, 0)
        return (0, c // b)

    def distance(self, a: int, b: int, c: int) -> int:
        return (abs(a) + abs(b)) // 2 + (abs(c) - abs(a)) // 2

    def solve(self, x: int, y: int) -> int:
        pointA = self.findPoint(x, y, x)
        pointB = self.findPointOnFirst(x, y, x)
        return self.distance(pointA[0], pointA[1], pointB[0]) + self.distance(pointB[0], pointB[1], y)

