import sys
import collections

class Solution:
    def get_graph(self, n, roads):
        graph = collections.defaultdict(list)
        for city1, city2 in roads:
            graph[city1].append(city2)
            graph[city2].append(city1)
        return graph

    def union(self, u, v, union_city, graph, union_road):
        u_root = self.find(u, union_city)
        v_root = self.find(v, union_city)
        if u_root == v_root:
            return False
        union_road[u_root].extend(union_road[v_root])
        for city in union_road[v_root]:
            union_city[city] = u_root
        union_road.pop(v_root)
        return True

    def find(self, city, union_city):
        if city!= union_city[city]:
            union_city[city] = self.find(union_city[city], union_city)
        return union_city[city]

    def solution(self, n, k, roads):
        if n == k:
            return 0
        roads = sorted(roads, key=lambda x: x[0])
        graph = self.get_graph(n, roads)
        union_city = {x:x for x in range(1, n + 1)}
        union_road = collections.defaultdict(list)
        for city1, city2 in roads:
            if self.union(city1, city2, union_city, graph, union_road):
                k -= 1
                if k == 0:
                    break
        distances = set()
        for city1, city2 in roads:
            if city1 in union_city and city2 in union_city:
                distances.add(union_road[union_city[city1]][union_city[city2]])
        return max(distances)

