import sys

class Solution:
    def __init__(self):
        self.n = int(sys.stdin.readline())
        self.memo = {}

    def fibo_helper(self, n: int) -> int:
        if n <= 1:
            return 1
        if n == 2:
            return 2
        if n in self.memo:
            return self.memo[n]
        self.memo[n] = self.fibo_helper(n-1) + self.fibo_helper(n-2)
        return self.memo[n]

    def fibo(self) -> int:
        n = self.n
        numbers = [self.fibo_helper(i) for i in range(n+1)]

        ans = 0
        modulo = 10 ** 9 + 7
        for i in range(n+1):
            for j in range(i+1, n+1):
                if numbers[i] == numbers[j]:
                    ans += 1

        ans = ans % modulo
        return ans

