import unittest

from collections import Counter, defaultdict
from functools import reduce
from operator import xor


class Solution:
    def solution(self, n: str) -> int:
        return max([sum(xor(Counter(range(1, int(n) + 1)).get(i, 0), k) for i, k in enumerate(self.permutation(int(n))))
                    for j in range(1, int(n) + 1)])

    def permutation(self, n: int):
        a = list(range(1, n + 1))
        while True:
            yield a
            a = [a[-1]] + a[:-1]
            a.reverse()


class TestSolution(unittest.TestCase):
